import globals from 'globals';
import eslint from '@eslint/js';
import react from 'eslint-plugin-react';
import reactHooks from 'eslint-plugin-react-hooks';
import tseslint from 'typescript-eslint';
import prettierRecommended from 'eslint-plugin-prettier/recommended';

export default tseslint.config(
  eslint.configs.recommended,
  react.configs.flat.recommended,
  tseslint.configs.recommended,
  {
    languageOptions: {
      globals: {
        ...globals.node,
        ...globals.browser,
        ...globals.es2021,
      },
      parserOptions: {
        ecmaVersion: 'latest',
      },
    },
    plugins: {
      'react-hooks': reactHooks,
    },
    rules: {
      'no-undef': 'off',
      'no-unused-expressions': 'off',
      '@typescript-eslint/no-unused-expressions': 'off',
      '@typescript-eslint/no-explicit-any': 'off',
      '@typescript-eslint/ban-types': 'off',
      '@typescript-eslint/ban-ts-comment': 'off',
      '@typescript-eslint/no-unused-vars': 'off',
      'react/react-in-jsx-scope': 'off',
      'react/prop-types': 'off',
      'react-hooks/rules-of-hooks': 'error',
      'react-hooks/exhaustive-deps': [
        'error',
        {
          additionalHooks: 'useModernLayoutEffect',
        },
      ],
      '@typescript-eslint/consistent-type-imports': [
        'error',
        {
          prefer: 'type-imports',
        },
      ],
    },
    settings: {
      react: {
        version: '18',
      },
    },
  },
  {
    files: ['packages/vue/**/*.{js,ts}'],
    rules: {
      'react-hooks/rules-of-hooks': 'off',
      'react-hooks/exhaustive-deps': 'off',
    },
  },
  prettierRecommended,
);

{
  "$schema": "https://turbo.build/schema.json",
  "globalDependencies": ["./config/scripts/build-api.mjs"],
  "tasks": {
    "build": {
      "dependsOn": ["^build"],
      "outputs": ["dist/**"],
      "inputs": [
        "packages/**/src/**",
        "packages/**/package.json",
        "packages/**/tsconfig.json",
        "packages/**/rollup.config.mjs",
        "packages/**/vite.config.ts"
      ]
    },
    "build:api": {
      "dependsOn": ["^build:api"],
      "outputs": ["dist/**/*.d{.ts,.mts}"],
      "inputs": [
        "src/**",
        "package.json",
        "tsconfig.json",
        "tsconfig.*.json",
        "api-extractor.json",
        "api-extractor.*.json"
      ]
    },
    "typecheck": {
      "dependsOn": ["^typecheck"],
      "outputs": ["out-tsc/**"],
      "inputs": ["src/**", "test/**", "tsconfig.json", "tsconfig.*.json"]
    },
    "publint": {
      "dependsOn": ["prepack"],
      "inputs": ["package.json", "dist/**"]
    },
    "dev": {
      "cache": false,
      "persistent": true
    },
    "clean": {
      "cache": false
    },
    "lint": {
      "cache": false
    },
    "format": {
      "cache": false
    },
    "test": {
      "dependsOn": ["config#build"],
      "cache": false
    },
    "test:watch": {
      "dependsOn": ["config#build"],
      "cache": false,
      "persistent": true
    },
    "playwright": {
      "dependsOn": ["build"],
      "cache": false
    },
    "prepack": {
      "dependsOn": ["build", "build:api"],
      "inputs": ["package.json", "dist/**"]
    }
  }
}
